import { StyleSheet } from "react-native";
import Constance from "../../theme/const";

const style = StyleSheet.create({
    default:{
        borderRadius:9,
        marginVertical:5,
        height:40,
        padding:0
    },
    label:{
        fontSize:Constance.small,
        fontWeight: '900',
        
    }
})
export default style;
